import { Tab, TabList, TabPanel, TabPanels, Tabs } from "@chakra-ui/tabs";
import { groupBy } from "lodash";
import React, { useState } from "react";
import Layout from "../../components/layout";
import Results from "./components/Results";
import Schedule from "./components/Schedule";
import ScheduleTabs from "./components/ScheduleTabs";

const schedule = ({ games }) => {
  console.log({ games });
  const { d1, d3 } = groupBy(games, "division");
  // const [d1, setD1] = useState({ d1Results: [], d1Upcoming: [] });
  // const [d3, setD3] = useState({ d3Results: [], d3Upcoming: [] });

  const { d1Results, d1Upcoming } = d1;
  const { d3Results, d3Upcoming } = d3;

  return (
    <Layout header="Schedule" margin>
      <Tabs variant="solid-rounded" isFitted size="sm" colorScheme="gray">
        <TabList>
          <Tab>Bombers DI</Tab>
          <Tab>Bombers DIII</Tab>
        </TabList>
        <TabPanels>
          <TabPanel>
            <ScheduleTabs
              upcoming={d1Upcoming}
              results={d1Results}
              division="D1"
            ></ScheduleTabs>
          </TabPanel>
          <TabPanel>
            <ScheduleTabs
              upcoming={d3Upcoming}
              results={d3Results}
              division="D3"
            ></ScheduleTabs>
          </TabPanel>
        </TabPanels>
      </Tabs>
    </Layout>
  );
};

export default schedule;
